import React from 'react'
import wave from "../img/wave.png"
import bg1 from "../img/bg.svg"


function backgroundg() {
  const submitHandler = e => {
    e.preventDefault();
    }
  return (
    <div>
    <img class={wave} src="wave" alt="" />
    <div class="container">

        <div class="img">
            <img src={bg1} alt=""/>
        </div>
    </div>
    </div>
  )
}

export default backgroundg
